import React from 'react';
import './App.css';
import Divider from "./Divider";
import logo from '/game_board.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p></p>
        <img src="game_board.png" />
        <img src={process.env.PUBLIC_URL + '/game_board.png'} />
        <p></p>
      </header>
       <Divider />
    </div>
  );
}

export default App;
